MoM_Change_1.query:
q = load "${App.Datasets.Job_Posting_vs_Covid.FullyQualifiedName}";
q = filter q by date('Date_Year', 'Date_Month', 'Date_Day') in ["2 months ago".."1 month ago"];
result = group q by ('Date_Year', 'Date_Month');
result = foreach result generate q.'Date_Year' + "~~~" + q.'Date_Month' as 'Date_Year~~~Date_Month', sum(q.'All_Jobs') as 'A';
result = group result by 'Date_Year~~~Date_Month';
result = foreach result generate 'Date_Year~~~Date_Month', first(A) as 'A', (sum(A) - sum(sum(A)) over ([-1..-1] partition by all order by ('Date_Year~~~Date_Month')))/(sum(sum(A)) over ([-1..-1] partition by all order by ('Date_Year~~~Date_Month'))) as 'B';
result = order result by ('Date_Year~~~Date_Month' desc);
result = limit result 2000;

